import React from "react";
import "./track-progress.css";

const TrackProgress = () => {
  let {
    size = 150,
    progress = 0,
    trackWidth = 10,
    trackColor = `#ddd`,
    indicatorWidth = 10,
    indicatorColor = `#07c`,
    indicatorCap = `round`,
    label = `Loading...`,
    labelColor = `#333`,
    spinnerMode = false,
    spinnerSpeed = 1,
  } = props;
  return (
    <svg className="svg-indicator">
      <circle className="svg-indicator-track" />
      <circle className="svg-indicator-indication" />
    </svg>
  );
};

export default TrackProgress;
